import React from 'react';
import './App.css';
import Header from './components/Header';
import MainSection from './components/MainSection';
import Notifications from './components/Notifications';
import SideSection from './components/SideSection';

function App() {
  return (
    <div>
    <Header />
    <Notifications topic='Lukijan mielipide' body='Lähes päivittäin saan kuulla potilaiden epäilyjä siitä, olenko oikea lääkäri'/>
    <Notifications topic='Päivän timantti' body='Reima Launonen kiipesi työväenluokasta yliopistoon, mutta huomasi pian olevansa kuin norsu posliinikaupassa – Kolme luokkahypyn tehnyttä kertoo, millainen kokemus yliopisto oli'/>
    <MainSection />
    <SideSection />
    </div>
  );
}

export default App;
